  case when exists(
    select
      case when exists(
        select 
          t1.col1 as c1,
          t2.col1 as c2,
          t3.col1 as c3
        from insert_on_error2 as t3
        where 0 limit 1) 
      then t2.col1 else t2.col1 end
      as c1,
      t2.col2 as c2
    from insert_on_error1 as t0
      inner join insert_on_error2 as t1
      inner join insert_on_error2 as t2 on t2.col3 is not null
      on (1)
    ) then 1 else 2 end
);

